        articles: this.articles,
        loading: false
    };
  }
  render() {
    return (
      <div className="container my-4">
        <h1>News Dose - Top Headlines</h1>
        <div className="row">
          <div className="col-md-4">
            <NewsItem
              title="mytitle"
              description="myDesc"
              imageUrl="https://ichef.bbci.co.uk/news/1024/branded_news/10A80/production/_123342286_gettyimages-1366658925.jpg"
            />
          </div>
          <div className="col-md-4">
            <NewsItem title="mytitle" description="myDesc" />
          </div>
          <div className="col-md-4">
            <NewsItem title="mytitle" description="myDesc" />
          </div>
        </div>
      </div>
    );
  }
}

export default News;
